var assert = require("assert");
import {parseHTML} from "../src/parser.js";
describe("parse html", function () {
  it("<a></a>", function () {
    let tree= parseHTML("<a></a>");
    console.log(tree);
    assert.equal(tree.children[0].tagName, "a");
    assert.equal(tree.children[0].children.length, 0);
  });
});

